import React, { useState, useEffect } from 'react';
import { Building2, Sparkles, RefreshCw } from 'lucide-react';
import Card from '../ui/Card';
import Button from '../ui/Button';
import { sendAIAction, getAIInsights } from '../../services/api';
import './OwnerView.css';

/**
 * Owner view component with AI insights panel
 */
const OwnerView = ({ aiLog, onShowSummary, onAIAction, t }) => {
  const [aiInsight, setAiInsight] = useState(null);
  const [insightLoading, setInsightLoading] = useState(false);
  const [insightError, setInsightError] = useState(null);

  // Fetch AI insights on mount
  useEffect(() => {
    fetchInsights();
  }, []);

  const fetchInsights = async () => {
    setInsightLoading(true);
    setInsightError(null);
    try {
      const data = await getAIInsights();
      setAiInsight(data);
    } catch (error) {
      console.error('Error fetching AI insights:', error);
      setInsightError('Unable to load AI insights');
      setAiInsight({ insight: '注专转  注专 !', bookings_count: 0 });
    } finally {
      setInsightLoading(false);
    }
  };

  const handleAIAction = async (type, room) => {
    // Call parent handler for log update
    if (onAIAction) {
      onAIAction(type, room);
    }
  };

  return (
    <div className="owner-view fade-in">
      <div className="owner-actions">
        <Button variant="secondary" onClick={onShowSummary}>
           {t.summary}
        </Button>
      </div>

      {/* AI Insights Panel */}
      <Card variant="gradient" className="ai-insight-card">
        <div className="card-header">
          <h4 className="card-title">
            <Sparkles size={20} />
            AI Insight
          </h4>
          <Button
            variant="ghost"
            size="sm"
            onClick={fetchInsights}
            disabled={insightLoading}
          >
            <RefreshCw size={16} className={insightLoading ? 'spin' : ''} />
          </Button>
        </div>
        <div className="card-body">
          {insightLoading ? (
            <div className="insight-loading">Loading...</div>
          ) : insightError ? (
            <div className="insight-error">{insightError}</div>
          ) : (
            <>
              <p className="insight-text">{aiInsight?.insight || 'System Ready...'}</p>
              {aiInsight?.bookings_count > 0 && (
                <span className="insight-meta">
                  Based on {aiInsight.bookings_count} bookings
                </span>
              )}
            </>
          )}
        </div>
      </Card>

      <Card variant="outlined" className="ai-log-card">
        <div className="card-header">
          <h4 className="card-title">{t.logTitle}</h4>
        </div>
        <div className="card-body">
          {aiLog.map((log, i) => (
            <div key={i} className="log-entry">
              {log}
            </div>
          ))}
        </div>
      </Card>

      <Card className="room-management-card">
        <div className="card-header">
          <h3 className="room-title">
            <Building2 size={24} />
             拽住专 / Villa Mykonos
          </h3>
        </div>
        <div className="card-body">
          <div className="room-item">
            <span className="room-name">{t.suite} 101</span>
            <div className="room-actions">
              <Button
                variant="danger"
                size="sm"
                onClick={() => handleAIAction('checkout', '101')}
              >
                {t.exit}
              </Button>
              <Button
                variant="accent"
                size="sm"
                onClick={() => handleAIAction('towels', '101')}
              >
                {t.towels}
              </Button>
            </div>
          </div>
        </div>
      </Card>
    </div>
  );
};

export default OwnerView;
